import {List, ListItem, ListItemText} from '@material-ui/core'
import { withStyles } from '@material-ui/core/styles';
import Tab from "./Tab.js";
import TabNav from "./Tab_Nav.js";
import useState from 'react';
const Item = withStyles(() => ({
	root: {
	  height: 20,
	  marginTop: 30,
	  backgroundColor: "#999999",
	  borderRadius: 8,
		Width: 1,
	},
	bar: {
	  backgroundColor: '#11c9d0',
	  transition: "1s ease",
	},
}))(ListItem);

function ScoreList({scores})
{  
	var scoreItems = [];
	[selected, setSelected] = useState("User\`s best scores");
	console.log("param:" + scores)
	for (let i = 0 ; i < scores.length; i++)
	{
		scoreItems.push(
			<Item>
				<ListItemText primary= {scores[i]}/>
			</Item>
		);
	}
	console.log("items");
	console.log(scoreItems);

	return(
		<TabNav tabs={['User\'s best scores', 'World\'s best scores']} selected={ this.state.selected } setSelected={ this.setSelected }>
		  <Tab isSelected={ this.state.selected === 'User\'s best scores' }>
			<p>Some test text</p>
		  </Tab>
		  <Tab isSelected={ this.state.selected === 'User\'s best scores' }>
			<List>
				{scoreItems}
			</List>);
		  </Tab>
		</TabNav>
	)
}

export default ScoreList;
